El poema es una composición satírica del escritor, periodista y político español Juan Martínez Villergas (1817-1894), conocido por sus obras humorísticas y satíricas durante el siglo XIX. Este soneto en particular juega con la palabra "MAS" y sus diferentes significados y usos.
